import React from "react";
import { styled } from "styled-components";

const StyledFooterItem = styled.p`
  color: #274e8e;
  line-height: 40px;

  & p {
    cursor: pointer;
  }
`;
export default function FooterItem(props) {
  return (
    <StyledFooterItem>
      {props.col_values.map((item) => (
        <p>{item}</p>
      ))}
    </StyledFooterItem>
  );
}
